import {Link} from "react-router-dom"
import Cards from "components/cards/cards"

export default function Ciudad(cities){

    return(
            <div>
                <div>
                    <Cards
                    cities= {cities}
                    />
                </div>

                <div>
                <Link to="/" >Informacion de la ciudad </Link>
                </div>

            </div>
    )
}
